const Quinceaneras =()=>{
    return(
        <>
      <Navbar/>
      <div>
        <h1 id="SFtitle"> Sample Flowers</h1>
        <h1 class="blahinfo">Quinceaneras</h1>
        </div>
       
        <div class="blahinfo">
        <h2>
        <h2>You did it!</h2>
         <div>Let's Celebrate that Milestone!</div>
        </h2>
        <div>
          <div>
         <img src="https://cdn11.bigcommerce.com/s-lzx6le/images/stencil/1280x1280/products/1241/2902/167398L__04164.1557610883.jpg?c=2" class="pic1" alt="pinkbouquet"></img>
        </div>
        </div>
        </div>
    </>
    );
};

export default Quinceaneras;
